import React, { useEffect } from "react";

export default function Panier() {
  useEffect(() => {
    fetch("panier")
      .then((data) => data.json())
      .then((resultat) =>
        console.log(resultat).catch((erreur) => console.log(erreur))
      );
  });
  return (
    <div>
      <h1>Page Panier</h1>
    </div>
  );
}
